Este soneto humorístico fue escrito por Manuel del Palacio (1831-1906), poeta español del Realismo que cultivó tanto la poesía seria como la satírica. Fue conocido por sus composiciones de tono festivo y por su humor inteligente, como se puede apreciar en este soneto que termina con un giro inesperado y cómico.
